const Table = () => {
  return (
    <div>
      <table>
        <th>PFM TRX CODE</th>
        <th>CATEGORY</th>
        <th>TRX DEFINITION</th>
        <th>TRX DESCRIPTION</th>
        <th>SOURCE TRX CODE</th>
        <th>SOURCE OWNER</th>
        <th>BUSINESS OWNER</th>
        <th>TRX CREATED</th>
        <th>TRX UPDATE</th>
        <th></th>
        <th></th>
      </table>
    </div>
  );
};

export default Table;
